import React from "react";
import {
  useGetData,
  //   usePostData,
  //   useEditData,
  //   useDeleteData,
} from "../../axios/hooks";

export default function Allusers() {
  const { data: posts, isLoading, isError } = useGetData(["posts"], "/user");
  console.log(posts?.email, 11111);

  if (isLoading) {
    return <p>isLoading</p>;
  }
  return (
    <div>
      <p>
        {posts?.map((e) => (
          <div>
            <h1>{e.email}</h1>
          </div>
        ))}
      </p>
    </div>
  );
}
